import { Link } from 'react-router-dom';
import { useSelector } from 'react-redux';
import EditMemberComp from './EditMemberComp'

const SubWatchedComp = ({id}) => {

    const subscriptions = useSelector(state => state.SubscriptionsReducer.subscriptions);
    const members = subscriptions.filter((sub)=> sub.movieId === id)


    const memberssss = useSelector(state => state.MembersReducer.members);


    const memberRep = members.map((mem, index)=>{
            return (
                memberssss.map((m) => {

                    if(mem.memberId === m._id){
                        return (
                            <li key={index}>
                            {/* <Link to={`/editmember/${mem.memberId}`}> {m.name}</Link>{',  '} */}
                            <Link to={<EditMemberComp id={mem.memberId}/>}> {m.name}</Link>{',  '}
                            {mem.date} 
                        </li>
                        )

                    }
                    return null;

                }
                )
            )
    }
    )





  return (
    <div>
        <strong>Subscriptions Watched</strong>
        <ul>
            {memberRep}
        </ul>
    </div>
  )
}

export default SubWatchedComp
